    synonyms:
    - -d
    args: !EmptyFlagArg {}
    optional: true
  - !Flag
    description: "the meaning of this parameter depends on the algorithm selected\
      \ in the -a option:\n* For BRZ it is used to make the maximal number of keys\
      \ in a bucket lower than 256.\nIn this case its value should be an integer in\
      \ the range [64,175]. Default is 128.\n* For BDZ it is used to determine the\
      \ size of some precomputed rank\ninformation and its value should be an integer\
      \ in the range [3,10]. Default\nis 7. The larger is this value, the more compact\
      \ are the resulting functions\nand the slower are them at evaluation time.\n\
      * For CHD and CHD_PH it is used to set the average number of keys per bucket\n\
      and its value should be an integer in the range [1,32]. Default is 4. The\n\
      larger is this value, the slower is the construction of the functions.\nThis\
      \ parameter has no effect for other algorithms."
    synonyms:
    - -b
    args: !EmptyFlagArg {}
    optional: true
  - !Flag
    description: "set the number of keys per bin for a t-perfect hashing function.\
      \ A t-perfect\nhash function allows at most t collisions in a given bin. This\
      \ parameter applies\nonly to the CHD and CHD_PH algorithms. Its value should\
      \ be an integer in the\nrange [1,128]. Defaul is 1"
